Content:
@ibrahimansar1 When allocating, the allocation is gradually moving to the new asset during the round as a mechanism against users allocating in the last seconds and highly influence the outcome. Your allocations should be visible soon and gradually moving over during the round.
Keep in mind that If you allocate after the round has started, the full allocation it's going to be moved over only in next round.
The current allocations is made available so users can see a live state of allocations without the gradual movement, but the round allocation is used for the rewards calculation.
